import React, { Component } from 'react';

class Bead extends Component {

  constructor(props){
    super(props);
    this.reColor = this.reColor.bind(this);
  }

  reColor(e){
    console.log(e)
  }

  render() {

    return (
      <div 
        className="object"
        style={{
          left: this.props.x, 
          top: this.props.y,
          width: this.props.width,
          height: this.props.height,
          borderRadius: 100,
          backgroundColor: this.props.color,
          position: "absolute",
          padding: 0,
          margin: 0
        }}
        onMouseOver
      >

      </div>
    )
  }
}

export default Bead;
